INSERT INTO `blog` VALUES (3,'http://www.examiner.com/article/should-you-read-your-teens-emails-and-text-messages','Should you read your teens emails and text messages?','<p>Recently we read about whether parents should read their child\'s diary or journal.  With the advances of technology, we need to take this a step further:  Should you read their emails or text messages?</p>\r\n<p>\r\nAgain we can go back to \"when safety trumps privacy.\"\r\n</p>\r\n<p>\r\nOur teens deserve to be trusted unless they give us reason to suspect something is wrong.  Is their behavior changing?  Here is a review of some warning signs (many are the same to determine if you should read their diaries).\r\n</p>\r\n<p>\r\n    Is your teen becoming very secretive? Sure, teens do like their privacy, however if you have a \"gut feeling\" something is deeper than a secret, you may have to cross that line.\r\n    Is your teen becoming withdrawn? Again, teens will develop some attitudes of not wanting to be with adults, however when it becomes extreme, it may be time to cross that line.\r\n</p>\r\n<p>\r\n    Is your teen changing peer groups? And this is not into a better one, however to one that is less than desirable? You will again attempt to talk to your teen and find out why and what happened to the other friends.\r\n</p>\r\n  <p>  Is your teens eating habits changing?</p>\r\n   <p>   Is your teen sleeping a lot? Bloodshot eyes? Do you suspect drug use?\r\n  </p>   <p> Is your teen sneaking out? Becoming extremely defiant? Not respecting your boundaries?</p>\r\n   <p>   Are they overly protective of their cell phones or computer?\r\n    Do they hide their cell phones? <p> </p> \r\n    <p>  Are they anxious when at their computer, seem fearful, attempt to hide their incoming emails?/<p> \r\n  <p>   Overall, is your teen slowly becoming a child you don\'t recognize?\r\n</p> <p> \r\nLike with determining if you should invade their privacy with their journals or diary, unless your teen or tween gives you good reason to read their private text and emails, as parents, we should respect their privacy.</p> \r\n<p> \r\nWhen it comes to younger children, under 10 years old, parents should always be allowed to see what they are doing.  Most younger children are usually not as protective as teens or tweens.  As a responsible parent, you will know when there are red flags or warning signs and you need to step in.\r\n</p><p>\r\nKeeping an open dialog with your tweens and teens is critical.  Letting them know you are there for them as well as talking to them about the issues of sexting, cyberbullying, predators and other areas of concern.\r\n</p><p>\r\nShould you read your child\'s emails or text messages?  Only you can answer that.\r\n</p><p>\r\nBe an educated parent, you will have safer children.</p>','http://www.examiner.com','2010-01-08'),(4,'http://www.huffingtonpost.com/2012/05/09/marriage-etiquette_n_1504617.html','Marriage Etiquette: Is It Ever OK To Read Your Spouse\'s Texts? ','\r\nMarriage Etiquette\r\n\r\nShould your spouse be allowed to check your text messages?\r\n\r\nThis is a question that writer Jillian Bolger asked in her recent article for Herald.ie, in which she recounts how her husband asked her to stop checking his phone.\r\n\r\nOn one hand, spouses should presumably have nothing to hide on their handheld devices, so checking your partner\'s cell from time to time shouldn\'t be that big of a deal. On the other hand, spouses should ideally trust each other enough to not feel the need to keep tabs on each other\'s mobile usage. ','Natasha Burton','2012-05-09');
